import NavegarIngreso from "../Registrar/NavegarIngreso"

import User from "./User"

export default function Menu(prop){
    const nombre=prop.nombre
    if (nombre !=='nadie'){
        return(
            <User nombre={nombre}/>
        )
    }
    return(
        <div>
            <NavegarIngreso/>
        </div> 
    )
}
